//const base64 = "";
export default function ResultScreen(props) {
  const base64 = props.route.params.image;
  let openShareDialogAsync = async (share) => {
    let filename = `AniMe-${Math.floor(Math.random() * 1000000)}.jpeg`; // or some other way to generate filename
    let filepath = `${FileSystem.documentDirectory}/${filename}`;
    await FileSystem.writeAsStringAsync(filepath, `${base64}`, {encoding: 'base64'});
    if(share) {
      if (!(await Sharing.isAvailableAsync())) {
        alert(`Uh oh, sharing isn't available on your platform`);
        return;
      }
      await Sharing.shareAsync(filepath, {mimeType: 'image/jpeg'});
    }
    else {
      const status = await MediaLibrary.requestPermissionsAsync();
      console.log(' status ', status)
      if (!status.granted) {
        alert('Sorry, we need media library permissions to make this work!');
        return;
      }
      const response = await MediaLibrary.saveToLibraryAsync(filepath)
      alert('Saved to Gallery')
    }
  };
  return (
    <View style={{backgroundColor: APP_STYLES.backgroundColor}}>
      <SafeAreaView>
        <View style={styles.container}>
          <View style={styles.headerContainer}>
            <Icon
              name='arrowleft'
              type='antdesign'
              color={APP_STYLES.iconColor}
              size={30}
              onPress={() => {
                props.navigation.goBack();
              }}
            />
            <View style={{height: '100%', alignItems: 'center', flexDirection: 'row'}}>
              <Image style={{width: 30, height: 30, marginRight: 20}}
                     source={require('./../../assets/images/ic_pro.png')}/>
              <Icon
                containerStyle={{marginRight: 20}}
                name='ios-images-outline'
                type='ionicon'
                color={APP_STYLES.iconColor}
                onPress={() => {
                  openShareDialogAsync(false)
                }}
              />
              <Icon
                name='upload'
                type='antdesign'
                color={APP_STYLES.iconColor}
                onPress={() => {
                  openShareDialogAsync(true)
                }}
              />
            </View>
          </View>
          <View style={styles.contentContainer}>
            <AdMobBanner
              bannerSize="banner"
              adUnitID="ca-app-pub-6824988815714853/4491478736" // Test ID, Replace with your-admob-unit-id
              servePersonalizedAds // true or false
              onDidFailToReceiveAdWithError={(e) => {
                console.log(e)
              }}/>
            <Image
              style={styles.image}
              source={{uri: `data:image/png;base64,${base64}`}}/>
            <View style={{height: 80}}></View>
          </View>
        </View>
      </SafeAreaView>
    </View>
  );
}

